import React from 'react';
import { Route, Routes } from 'react-router-dom';
import NavBar from './components/navBar';
import Footer from './components/footer';
import LandingPage from './components/landingPage';

function App() {
  return (
    <React.Fragment>
      <NavBar />
      <Routes>
        <Route />
      </Routes>

      <LandingPage />
      <Footer />
    </React.Fragment >
  );
}

export default App;
